%% run_final_check.m
clear; close all; clc;

% 环境设置
x_len = 5; y_len = 5;
start = [1, 1]; final = [3, 4];
obs = [2,2; 3,2; 3,3; 2,4; 4,4; 2,5];
% start对结果不起作用  这里只是为了统一接口。后面Sarsa算法会用到
env = GridWorld(x_len, y_len, start, final, obs);

% Agent 设置
gamma = 0.9;
episode_len = 100;
pe_len = 10;
agent = PolicyIterationAgent(env.State_Space_Size, 5, gamma, episode_len, pe_len);

% 训练
agent.train(env); %[output:37ebdc29]

% 结果
[V, Pol] = agent.get_results();

% 打印验证
final_idx = env.coord2idx(final);
target_val = V(final_idx);
fprintf('终点价值: %.2f (预期 10.00)\n', target_val); %[output:461f26e5]

% 绘图
env.plot_values(V); %[output:4b096c0a]
env.plot_policy(Pol);  % 暂时不能绘制概率策略 %[output:8ad1852e]

